import logo from 'assets/images/logo.jpg';

import React from 'react';
import { Link } from 'react-router-dom';

const NavHeader = () => (
  <Link to="home">
    <section className="logo-container">
      <img src={logo} alt="logo" />
    </section>
  </Link>
);

export default NavHeader;
